import { React, useState } from "react";
import { BrowserRouter as Router, useHistory } from "react-router-dom";
import { Main as Mainbar } from "../../styledComponents";

const Main = () => {
  //Log in State manager
  const [state, setState] = useState({
    Email: "",
    password: "",
  });
  // collects user info and add them to state
  const handleSubmit = (e) => {
    const { name, value } = e.target;
    setState((prevState) => ({
      ...prevState,
      [name]: value,
      loadState: false,
    }));
  };

  return (
    <Mainbar>
      <Router>
        <div className="container">
          <div className="form">
            <div className="company-profile">
              <p>
                Find out why <span>Countfy</span> is the Leading Financial
                management software and why we receive more that
                <span>12 million</span> Visitors in a single day Countfy Makes
                tracking and managing of your finances easy, fast and secure. So
                let's get started now.
              </p>
            </div>

            <div className="login-form">
              <input
                className="email"
                type="text"
                name="email"
                placeholder="Email"
                required="required"
                onChange={handleSubmit}
              />
              <input
                className="password"
                type="password"
                name="password"
                placeholder="password"
                required="required"
                onChange={handleSubmit}
              />
              <button
                onClick={() => {
                  console.log(state);
                }}
              >
                Let's get started
              </button>
            </div>
          </div>
        </div>
      </Router>
    </Mainbar>
  );
};

export default Main;
